Ricardo Gil (1858-1908) fue un poeta español del post-romanticismo que se encuadra en la llamada "Generación del 80". Este soneto, "Retrato", es uno de sus poemas más conocidos y es un autorretrato lírico característico de su estilo introspectivo y melancólico.
